// SPDX-License-Identifier: MIT
pragma solidity 0.8.6;

library Strings {
    bytes16 private constant _HEX_SYMBOLS = "0123456789abcdef";

    function toString(uint256 value) internal pure returns (string memory) {
        // Inspired by OraclizeAPI's implementation - MIT licence
        // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}

library Address {
    function isContractAddr(address account) internal view returns (bool) {
        return account.code.length > 0;
    }
}

library SafeMath {
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        return a - b;
    }

    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        return a * b;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        return a / b;
    }
}

library Counters {
    struct Counter {
        uint256 _value; // default: 0
    }

    function current(Counter storage counter) internal view returns (uint256) {
        return counter._value;
    }

    function increment(Counter storage counter) internal {
        unchecked {
            counter._value += 1;
        }
    }
}

interface IERC165 {
    function supportsInterface(bytes4 interfaceId) external view returns (bool);
}

interface IERC721 is IERC165 {
    event Transfer(
        address indexed from,
        address indexed to,
        uint256 indexed tokenId
    );

    event Approval(
        address indexed owner,
        address indexed approved,
        uint256 indexed tokenId
    );

    event ApprovalForAll(
        address indexed owner,
        address indexed operator,
        bool approved
    );

    function balanceOf(address owner) external view returns (uint256 balance);

    function ownerOf(uint256 tokenId) external view returns (address owner);

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes calldata data
    ) external;

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external;

    function transferFrom(address from, address to, uint256 tokenId) external;

    function approve(address to, uint256 tokenId) external;

    function setApprovalForAll(address operator, bool _approved) external;

    function getApproved(
        uint256 tokenId
    ) external view returns (address operator);

    function isApprovedForAll(
        address owner,
        address operator
    ) external view returns (bool);
}

interface IERC721Receiver {
    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external returns (bytes4);
}

interface IERC721Metadata is IERC721 {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function tokenURI(uint256 tokenId) external view returns (string memory);
}

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }
}

abstract contract ERC165 is IERC165 {
    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override returns (bool) {
        return interfaceId == type(IERC165).interfaceId;
    }
}

contract ERC721 is Context, ERC165, IERC721, IERC721Metadata {
    using Address for address;
    using Strings for uint256;

    string private _name;

    string private _symbol;

    mapping(uint256 => address) private _owners;

    mapping(address => uint256) private _balances;

    mapping(uint256 => address) private _tokenApprovals;

    mapping(address => mapping(address => bool)) private _operatorApprovals;

    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC721).interfaceId ||
            interfaceId == type(IERC721Metadata).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function balanceOf(
        address owner
    ) public view virtual override returns (uint256) {
        require(
            owner != address(0),
            "ERC721: balance query for the zero address"
        );
        return _balances[owner];
    }

    function ownerOf(
        uint256 tokenId
    ) public view virtual override returns (address) {
        address owner = _owners[tokenId];
        require(
            owner != address(0),
            "ERC721: owner query for nonexistent token"
        );
        return owner;
    }

    function name() external view virtual override returns (string memory) {
        return _name;
    }

    function symbol() external view virtual override returns (string memory) {
        return _symbol;
    }

    function tokenURI(
        uint256 tokenId
    ) external view virtual override returns (string memory) {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        string memory baseURI = _baseURI();
        return
            bytes(baseURI).length > 0
                ? string(abi.encodePacked(baseURI, tokenId.toString()))
                : "";
    }

    function _baseURI() internal view virtual returns (string memory) {
        return "";
    }

    function approve(address to, uint256 tokenId) external virtual override {
        address owner = ERC721.ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(
            _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _approve(to, tokenId);
    }

    function getApproved(
        uint256 tokenId
    ) public view virtual override returns (address) {
        require(
            _exists(tokenId),
            "ERC721: approved query for nonexistent token"
        );

        return _tokenApprovals[tokenId];
    }

    function setApprovalForAll(
        address operator,
        bool approved
    ) external virtual override {
        require(operator != _msgSender(), "ERC721: approve to caller");

        _operatorApprovals[_msgSender()][operator] = approved;
        emit ApprovalForAll(_msgSender(), operator, approved);
    }

    function isApprovedForAll(
        address owner,
        address operator
    ) public view virtual override returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external virtual override {
        //solhint-disable-next-line max-line-length
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "ERC721: transfer caller is not owner nor approved"
        );

        _transfer(from, to, tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) external virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(
            _isApprovedOrOwner(_msgSender(), tokenId),
            "ERC721: transfer caller is not owner nor approved"
        );
        _safeTransfer(from, to, tokenId, _data);
    }

    function _safeTransfer(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) internal virtual {
        _transfer(from, to, tokenId);
        require(
            _checkOnERC721Received(from, to, tokenId, _data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _owners[tokenId] != address(0);
    }

    function _isApprovedOrOwner(
        address spender,
        uint256 tokenId
    ) internal view virtual returns (bool) {
        require(
            _exists(tokenId),
            "ERC721: operator query for nonexistent token"
        );
        address owner = ERC721.ownerOf(tokenId);
        return (spender == owner ||
            getApproved(tokenId) == spender ||
            isApprovedForAll(owner, spender));
    }

    function _safeMint(address to, uint256 tokenId) internal virtual {
        _safeMint(to, tokenId, "");
    }

    function _safeMint(
        address to,
        uint256 tokenId,
        bytes memory _data
    ) internal virtual {
        _mint(to, tokenId);
        require(
            _checkOnERC721Received(address(0), to, tokenId, _data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    function _mint(address to, uint256 tokenId) internal virtual {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);

        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);
    }

    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(
            ERC721.ownerOf(tokenId) == from,
            "ERC721: transfer of token that is not own"
        );
        require(to != address(0), "ERC721: transfer to the zero address");

        _beforeTokenTransfer(from, to, tokenId);

        // Clear approvals from the previous owner
        _approve(address(0), tokenId);

        _balances[from] -= 1;
        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);
    }

    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[tokenId] = to;
        emit Approval(ERC721.ownerOf(tokenId), to, tokenId);
    }

    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) private returns (bool) {
        if (to.isContractAddr()) {
            try
                IERC721Receiver(to).onERC721Received(
                    _msgSender(),
                    from,
                    tokenId,
                    _data
                )
            returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert(
                        "ERC721: transfer to non ERC721Receiver implementer"
                    );
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {}
}

interface IERC721Enumerable is IERC721 {
    function totalSupply() external view returns (uint256);

    function tokenOfOwnerByIndex(
        address owner,
        uint256 index
    ) external view returns (uint256 tokenId);

    function tokenByIndex(uint256 index) external view returns (uint256);
}

abstract contract ERC721Enumerable is ERC721, IERC721Enumerable {
    mapping(address => mapping(uint256 => uint256)) private _ownedTokens;
    mapping(uint256 => uint256) private _ownedTokensIndex;
    uint256[] private _allTokens;
    mapping(uint256 => uint256) private _allTokensIndex;

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(IERC165, ERC721) returns (bool) {
        return
            interfaceId == type(IERC721Enumerable).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function tokenOfOwnerByIndex(
        address owner,
        uint256 index
    ) public view virtual override returns (uint256) {
        require(
            index < ERC721.balanceOf(owner),
            "ERC721Enumerable: owner index out of bounds"
        );
        return _ownedTokens[owner][index];
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _allTokens.length;
    }

    function tokenByIndex(
        uint256 index
    ) external view virtual override returns (uint256) {
        require(
            index < ERC721Enumerable.totalSupply(),
            "ERC721Enumerable: global index out of bounds"
        );
        return _allTokens[index];
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        super._beforeTokenTransfer(from, to, tokenId);

        if (from == address(0)) {
            _addTokenToAllTokensEnumeration(tokenId);
        } else if (from != to) {
            _removeTokenFromOwnerEnumeration(from, tokenId);
        }
        if (to == address(0)) {
            _removeTokenFromAllTokensEnumeration(tokenId);
        } else if (to != from) {
            _addTokenToOwnerEnumeration(to, tokenId);
        }
    }

    function _addTokenToOwnerEnumeration(address to, uint256 tokenId) private {
        uint256 length = ERC721.balanceOf(to);
        _ownedTokens[to][length] = tokenId;
        _ownedTokensIndex[tokenId] = length;
    }

    function _addTokenToAllTokensEnumeration(uint256 tokenId) private {
        _allTokensIndex[tokenId] = _allTokens.length;
        _allTokens.push(tokenId);
    }

    function _removeTokenFromOwnerEnumeration(
        address from,
        uint256 tokenId
    ) private {
        uint256 lastTokenIndex = ERC721.balanceOf(from) - 1;
        uint256 tokenIndex = _ownedTokensIndex[tokenId];

        // When the token to delete is the last token, the swap operation is unnecessary
        if (tokenIndex != lastTokenIndex) {
            uint256 lastTokenId = _ownedTokens[from][lastTokenIndex];

            _ownedTokens[from][tokenIndex] = lastTokenId; // Move the last token to the slot of the to-delete token
            _ownedTokensIndex[lastTokenId] = tokenIndex; // Update the moved token's index
        }

        // This also deletes the contents at the last position of the array
        delete _ownedTokensIndex[tokenId];
        delete _ownedTokens[from][lastTokenIndex];
    }

    function _removeTokenFromAllTokensEnumeration(uint256 tokenId) private {
        // To prevent a gap in the tokens array, we store the last token in the index of the token to delete, and
        // then delete the last slot (swap and pop).

        uint256 lastTokenIndex = _allTokens.length - 1;
        uint256 tokenIndex = _allTokensIndex[tokenId];

        // When the token to delete is the last token, the swap operation is unnecessary. However, since this occurs so
        // rarely (when the last minted token is burnt) that we still do the swap here to avoid the gas cost of adding
        // an 'if' statement (like in _removeTokenFromOwnerEnumeration)
        uint256 lastTokenId = _allTokens[lastTokenIndex];

        _allTokens[tokenIndex] = lastTokenId; // Move the last token to the slot of the to-delete token
        _allTokensIndex[lastTokenId] = tokenIndex; // Update the moved token's index

        // This also deletes the contents at the last position of the array
        delete _allTokensIndex[tokenId];
        _allTokens.pop();
    }
}

abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    constructor() {
        _setOwner(_msgSender());
    }

    function owner() public view virtual returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    function renounceOwnership() external virtual onlyOwner {
        _setOwner(address(0));
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        _setOwner(newOwner);
    }

    function _setOwner(address newOwner) internal {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

interface IERC2981 is IERC165 {
    /**
     * @dev Returns how much royalty is owed and to whom, based on a sale price that may be denominated in any unit of
     * exchange. The royalty amount is denominated and should be paid in that same unit of exchange.
     */
    function royaltyInfo(
        uint256 tokenId,
        uint256 salePrice
    ) external view returns (address receiver, uint256 royaltyAmount);
}

abstract contract ERC2981 is IERC2981, ERC165 {
    struct RoyaltyInfo {
        address receiver;
        uint96 royaltyFraction;
    }

    RoyaltyInfo private _defaultRoyaltyInfo;
    mapping(uint256 => RoyaltyInfo) private _tokenRoyaltyInfo;

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(IERC165, ERC165) returns (bool) {
        return
            interfaceId == type(IERC2981).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function royaltyInfo(
        uint256 _tokenId,
        uint256 _salePrice
    ) public view virtual override returns (address, uint256) {
        RoyaltyInfo memory royalty = _tokenRoyaltyInfo[_tokenId];

        if (royalty.receiver == address(0)) {
            royalty = _defaultRoyaltyInfo;
        }

        uint256 royaltyAmount = (_salePrice * royalty.royaltyFraction) /
            _feeDenominator();

        return (royalty.receiver, royaltyAmount);
    }

    function _feeDenominator() internal pure virtual returns (uint96) {
        return 10000;
    }

    function _setDefaultRoyalty(
        address receiver,
        uint96 feeNumerator
    ) internal virtual {
        require(
            feeNumerator <= _feeDenominator(),
            "ERC2981: royalty fee will exceed salePrice"
        );
        require(receiver != address(0), "ERC2981: invalid receiver");

        _defaultRoyaltyInfo = RoyaltyInfo(receiver, feeNumerator);
    }

    function _deleteDefaultRoyalty() internal virtual {
        delete _defaultRoyaltyInfo;
    }

    function _setTokenRoyalty(
        uint256 tokenId,
        address receiver,
        uint96 feeNumerator
    ) internal virtual {
        require(
            feeNumerator <= _feeDenominator(),
            "ERC2981: royalty fee will exceed salePrice"
        );
        require(receiver != address(0), "ERC2981: Invalid parameters");

        _tokenRoyaltyInfo[tokenId] = RoyaltyInfo(receiver, feeNumerator);
    }

    function _resetTokenRoyalty(uint256 tokenId) internal virtual {
        delete _tokenRoyaltyInfo[tokenId];
    }
}

contract NFTContract is ERC721Enumerable, ERC2981, Ownable {
    using SafeMath for uint256;
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenIdTracker;

    uint256 public immutable MAX_ELEMENTS;
    uint256 public PRICE;
    uint256 public PRESALE_PRICE;
    uint256 public immutable MAX_MINT_TX;
    uint256 public immutable MAX_BY_MINT;
    uint256 public immutable PRESALE_MINT_LIMIT;
    uint256 public immutable MAX_MINT_WHITELIST_TX;
    uint256 public immutable MAX_BY_MINT_WHITELIST;
    uint256 public SALE_START; //Sunday, July 11, 2022, 00:00:00 UTC
    uint256 public PRESALE_START; //Monday, July 09, 2022, 00:00:00 UTC

    bool public isPaused = false;
    bool public isRevealed = false;

    mapping(address => bool) private _whiteList;
    mapping(address => uint256) private _whiteListClaimed;
    mapping(address => uint256) private _generalClaimed;

    bool[] private ennabledFeatures;
    uint256 private _reservedCount = 0;
    uint256 private _presaleMintCount = 0;

    string private notRevealedtokenUri;
    string public baseTokenURI;

    event CreateAlphaOctopusNFT(uint256 indexed id);
    event PresaleTimeChanged(uint256 indexed newTimestamp);
    event PresalePriceChanged(uint256 indexed newPrice);
    event SaleTimeChanged(uint256 indexed newTimestamp);
    event SalePriceChanged(uint256 indexed newPrice);

    address private saleFundsReceiver;
    //string
    uint256 constant CID_UNREVEAL_METADATA = 0;
    uint256 constant CID_METADATA = 1;

    //address
    uint256 constant OWNER = 0;
    uint256 constant ADDRESS_SALE_AMT = 1;
    uint256 constant ADDRESS_ROYALTY = 2;

    //uint256

    uint256 constant COLLECTION_SIZE = 0;
    uint256 constant MINTS_PER_TX = 1;
    uint256 constant MINT_PRICE = 2;
    uint256 constant MINTS_PER_WALLET = 3;
    uint256 constant MINT_START_TIME = 4;
    uint256 constant ROYALTY_BIPS = 5;
    uint256 constant PRESALE_LIMIT = 6;
    uint256 constant PRESALE_MINT_PRICE = 7;
    uint256 constant PRESALE_MINT_PER_TX = 8;
    uint256 constant PRESALE_MINT_PER_WALLET = 9;

    //boolean
    uint256 constant ENABLE_PRESALE = 0;
    uint256 constant ENABLE_AIRDROPS = 1;
    uint256 constant ENABLE_CHANGE_MINTING_PRICES = 2;
    uint256 constant ENABLE_CHANGE_MINTING_TIMING = 3;
    uint256 constant ENABLE_NFT_REVEAL = 4;
    uint256 constant ENABLE_PREMINT = 5;
    uint256 constant ENABLE_COLLECTION_BASE_URI = 6;

    constructor(
        string memory name_,
        string memory symbol_,
        string[] memory inputString,
        address[] memory inputAddress,
        uint256[] memory inputUint256,
        bool[] memory inputBoolean
    ) ERC721(name_, symbol_) {
        MAX_ELEMENTS = inputUint256[COLLECTION_SIZE];
        MAX_MINT_TX = inputUint256[MINTS_PER_TX];
        PRICE = inputUint256[MINT_PRICE];
        MAX_BY_MINT = inputUint256[MINTS_PER_WALLET];
        SALE_START = inputUint256[MINT_START_TIME];
        PRESALE_MINT_LIMIT = inputUint256[PRESALE_LIMIT];
        PRESALE_PRICE = inputUint256[PRESALE_MINT_PRICE];
        MAX_MINT_WHITELIST_TX = inputUint256[PRESALE_MINT_PER_TX];
        MAX_BY_MINT_WHITELIST = inputUint256[PRESALE_MINT_PER_WALLET];
        ennabledFeatures = inputBoolean;
        if (!ennabledFeatures[ENABLE_NFT_REVEAL]) {
            isRevealed = true;
        }
        _setDefaultRoyalty(
            inputAddress[ADDRESS_ROYALTY],
            uint96(inputUint256[ROYALTY_BIPS])
        );
        saleFundsReceiver = inputAddress[ADDRESS_SALE_AMT];
        _setOwner(inputAddress[OWNER]);
        notRevealedtokenUri = inputString[CID_UNREVEAL_METADATA];
        baseTokenURI = inputString[CID_METADATA];
        _tokenIdTracker.increment();
    }

    modifier saleIsOpen() {
        if (_msgSender() != owner()) {
            require(SALE_START < block.timestamp, "Sale is not open");
        }
        _;
    }

    modifier enabled(uint256 featureIndex) {
        _checkFeature(featureIndex);
        _;
    }
    modifier preSaleIsOpen() {
        if (_msgSender() != owner()) {
            require(PRESALE_START < block.timestamp, "Pre Sale is not open");
            require(SALE_START > block.timestamp, "Pre Sale is closed.");
        }
        _;
    }

    function _checkFeature(uint256 featureIndex) internal view {
        if (!ennabledFeatures[featureIndex]) {
            revert(string(abi.encodePacked("Feature Not Enabled.")));
        }
    }

    function isPresaleOpen() external view returns (bool) {
        if (PRESALE_START < block.timestamp && SALE_START > block.timestamp)
            return true;
        else return false;
    }

    function _totalSupply() internal view returns (uint256) {
        return _tokenIdTracker.current();
    }

    function totalMint() external view returns (uint256) {
        return _totalSupply();
    }

    function reserveTokens(uint256 count) external onlyOwner enabled(ENABLE_PREMINT) {
        uint256 i;
        for (i = 0; i < count; i++) {
            _reservedCount++;
            _mintAnElement(msg.sender);
        }
    }

    function mint(uint256 _count) external payable saleIsOpen {
        uint256 total = _tokenIdTracker.current().sub(1);
        require(total + _count <= MAX_ELEMENTS, "Max limit");
        require(total <= MAX_ELEMENTS, "All Alpha Octopus NFT's are sold out");
        require(_count <= MAX_BY_MINT, "Exceeds allowed NFT's per transaction");
        require(!isPaused, "Sale is Paused.");
        require(
            _generalClaimed[_msgSender()] + _count <= MAX_BY_MINT,
            "Exceeds your minting quota."
        );
        require(msg.value >= salePrice(_count), "Value below price");


        _generalClaimed[_msgSender()] += _count;
        for (uint256 i = 0; i < _count; i++) {
            _mintAnElement(_msgSender());
        }
        _withdraw(owner(), address(this).balance);
    }

    function presaleMint(
        uint256 _count
    ) external payable preSaleIsOpen enabled(ENABLE_PRESALE) {
        require(_whiteList[msg.sender], "You are not in whitelist");
        require(
            _count <= MAX_BY_MINT_WHITELIST,
            "More then allowed per transaction."
        );
        require(
            _whiteListClaimed[msg.sender] + _count <= MAX_BY_MINT_WHITELIST,
            "Exceeds your whitelist minting quota."
        );
        uint256 total = _tokenIdTracker.current().sub(1);
        require(total + _count <= PRESALE_MINT_LIMIT, "Max presale limit");
        require(total <= PRESALE_MINT_LIMIT, "All presale NFT's are sold out");
        require(msg.value >= presalePrice(_count), "Value below price");
        require(!isPaused, "Sale is Paused.");
        _whiteListClaimed[msg.sender] += _count;
        _presaleMintCount += _count;
        for (uint256 i = 0; i < _count; i++) {

            _mintAnElement(msg.sender);
        }
        _withdraw(owner(), address(this).balance);
    }

    function airdropNFT(
        address[] memory winners
    ) external onlyOwner enabled(ENABLE_AIRDROPS) {
        uint256 total = _tokenIdTracker.current().sub(1);
        require(total + winners.length <= MAX_ELEMENTS, "Max limit");
        require(
            winners.length > 0,
            "Please provide the list of wallets for the airdrop"
        );
        for (uint256 i = 0; i < winners.length; i++) {
            _mintAnElement(winners[i]);
        }
    }

    function _mintAnElement(address _to) private {
        uint256 id = _totalSupply();
        _tokenIdTracker.increment();
        _safeMint(_to, id);
        emit CreateAlphaOctopusNFT(id);
    }

    function revealCollection() external onlyOwner enabled(ENABLE_NFT_REVEAL) {
        isRevealed = true;
    }

    function salePrice(uint256 _count) public view returns (uint256) {
        return PRICE.mul(_count);
    }

    function presalePrice(
        uint256 _count
    ) public view enabled(ENABLE_PRESALE) returns (uint256) {
        return PRESALE_PRICE.mul(_count);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function setBaseURI(string memory baseURI) public onlyOwner enabled(ENABLE_COLLECTION_BASE_URI) {
        baseTokenURI = baseURI;
    }

    function tokenURI(
        uint256 tokenId
    ) external view virtual override returns (string memory) {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        uint256 metaId = tokenId;
        string memory uriSuffix = ".json";
        string memory currentBaseURI = _baseURI();
        if (isRevealed) {
            return
                bytes(currentBaseURI).length > 0
                    ? string(
                        abi.encodePacked(
                            currentBaseURI,
                            metaId.toString(),
                            uriSuffix
                        )
                    )
                    : "";
        } else {
            return string(abi.encodePacked(notRevealedtokenUri));
        }
    }

    function walletOfOwner(
        address _owner
    ) external view returns (uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for (uint256 i = 0; i < tokenCount; i++) {
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }

        return tokensId;
    }

    function setPresaleTime(
        uint256 _presaleTime
    )
        external
        onlyOwner
        enabled(ENABLE_PRESALE)
        enabled(ENABLE_CHANGE_MINTING_TIMING)
    {
        PRESALE_START = _presaleTime;
        emit PresaleTimeChanged(_presaleTime);
    }

    function setSaleTime(
        uint256 _saleTime
    ) external onlyOwner enabled(ENABLE_CHANGE_MINTING_TIMING) {
        SALE_START = _saleTime;
        emit SaleTimeChanged(_saleTime);
    }

    function pauseMinting() external onlyOwner {
        isPaused = true;
    }

    function resumeMinting() external onlyOwner {
        isPaused = false;
    }

    function setPresalePrice(
        uint256 _price
    )
        external
        onlyOwner
        enabled(ENABLE_PRESALE)
        enabled(ENABLE_CHANGE_MINTING_PRICES)
    {
        PRESALE_PRICE = _price;
        emit PresalePriceChanged(_price);
    }

    function setSalePrice(
        uint256 _price
    ) external onlyOwner enabled(ENABLE_CHANGE_MINTING_PRICES) {
        PRICE = _price;
        emit SalePriceChanged(_price);
    }

    function addToWhiteList(
        address[] calldata addresses
    ) external onlyOwner enabled(ENABLE_PRESALE) {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Null address found");

            _whiteList[addresses[i]] = true;
            _whiteListClaimed[addresses[i]] > 0
                ? _whiteListClaimed[addresses[i]]
                : 0;
        }
    }

    function addressInWhitelist(
        address addr
    ) external view enabled(ENABLE_PRESALE) returns (bool) {
        return _whiteList[addr];
    }

    function removeFromWhiteList(
        address[] calldata addresses
    ) external onlyOwner enabled(ENABLE_PRESALE) {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Null address found");

            _whiteList[addresses[i]] = false;
        }
    }

    function withdrawAll() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0);
        _withdraw(owner(), balance);
    }

    function _withdraw(address _address, uint256 _amount) private {
        payable(_address).transfer(_amount);
    }

    function setRoyaltyInfo(
        address _receiver,
        uint96 _royaltyFeesInBips
    ) public onlyOwner {
        _setDefaultRoyalty(_receiver, _royaltyFeesInBips);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721Enumerable, ERC2981) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
